        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-1914258183":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"0","jsonContent":"{\"content\":[{\"content\":{\"params\":{\"text\":\"<p>La peau du contour des yeux est fine et fragile. Lorsqu’on est fatigué ou malade, le sang circule moins bien et le teint blanchit. Du coup, les minuscules vaisseaux sanguins sous les yeux apparaissent davantage et foncent la peau à cet endroit. En plus, nos paupières clignent plus de 10 000 fois par jour ! A la fin de la journée, la peau autour des yeux s’affaisse et se creuse. Les cernes sont alors plus marqués. L’hérédité joue aussi. Dans certaines familles on a plus facilement des cernes que dans d’autres. C’est injuste, mais c’est comme ça !</p>\\n\\n<p style=\\\"text-align:right\\\">D’après <em>Science &amp; Vie découvertes</em>, avril 2002.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"ff6e3190-6bcb-4865-9fae-ab0f06c27983\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"playerMode\":\"full\",\"fitToWrapper\":false,\"controls\":true,\"autoplay\":false,\"contentName\":\"Audio\",\"files\":[{\"path\":\"data:audio/mpeg;base64,SUQzAwAAAAAyDFBSSVYAABECAABYTVAAPD94cGFja2V0IGJlZ2luPSLvu78iIGlkPSJXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQiPz4KPHg6eG1wbWV0YSB4bWxuczp4PSJhZG9iZTpuczptZXRhLyIgeDp4bXB0az0iQWRvYmUgWE1QIENvcmUgNS4zLWMwMTEgNjYuMTQ1NjYxLCAyMDEyLzAyLzA2LTE0OjU2OjI3ICAgICAgICAiPgogPHJkZjpSREYgeG1sbnM6cmRmPSJodHRwOi8vd3d3LnczLm9yZy8xOTk5LzAyLzIyLXJkZi1zeW50YXgtbnMjIj4KICA8cmRmOkRlc2NyaXB0aW9uIHJkZjphYm91dD0iIgogICAgeG1sbnM6YmV4dD0iaHR0cDovL25zLmFkb2JlLmNvbS9id2YvYmV4dC8xLjAvIgogICAgeG1sbnM6eG1wRE09Imh0dHA6Ly9ucy5hZG9iZS5jb20veG1wLzEuMC9EeW5hbWljTWVkaWEvIgogICAgeG1sbnM6eG1wPSJodHRwOi8vbnMuYWRvYmUuY29tL3hhcC
